var PREBID_TIMEOUT = 800;
var curResolution = getResolution();
var refreshTimeout;
var showLogs = false;

var _prefix = "ad_";
var _target_sri = "old_sri";

//Adomik randomizer for ad call key value targeting
window.Adomik = window.Adomik || {};
Adomik.hour = (new Date).getUTCHours().toString();
Adomik.randomAdGroup = function() {
  var rand = Math.random();
  switch (false) {
      case !(rand < 0.09): return "ad_ex" + (Math.floor(100 * rand));
      case !(rand < 0.10): return "ad_bc";
      default: return "ad_opt";
  }
};

window.addEventListener("load", load);

function load(){
    window.addEventListener("resize", function() {
        var newResolution = getResolution();
        if (newResolution != curResolution) {
            curResolution = newResolution;
            clearTimeout(refreshTimeout);
            refreshTimeout = window.setTimeout(function(){ refreshAllSlots() }, 50);

            iasLog("New resolution: " + curResolution);
        }

        adjustStickySkyscraper();
    });

    adjustStickySkyscraper();

    window.addEventListener("scroll", adjustStickySkyscraper);
}

function refreshAllSlots() {
    if (typeof pbjs != 'undefined' && pbjs != null) {
        removePrebidAdUnits();
        pbAdUnits = getPrebidSlots(curResolution);
        addPrebidAdUnits(pbAdUnits);
    } else {
        googletag.cmd.push(function() { googletag.pubads().refresh() });
    }
}

function renderLayout() {
    if (curResolution != "mobile_hr" && curResolution != "mobile_lr" && !isMobileDevice()) {
        // repositioning of the sticky skyscraper once it is loaded
        if (typeof dfpSlots != 'undefined' && dfpSlots["leftslot_a"])
            dfpSlots["leftslot_a"].renderCallback = function() { adjustStickySkyscraper() };
    }
}

function getResolution() {
    var res = "desktop";
    try{
        if (window.matchMedia("(max-width: 761px)").matches) {
            res = "mobile_lr";
            if (window.matchMedia("(min-height: 550px)").matches)
                res = "mobile_hr";
        }
        else if (window.matchMedia("(min-width: 762px) and (max-width: 948px)").matches)
            res = "tablet";
        else if (window.matchMedia("(min-width: 1240px)").matches)
            res = "hd";
    }catch(err){}
    return res;
}

function getCookie(cname){
    var regexp = new RegExp('(?:^|; )' + cname + '=([^;]*)(?:$|; )');
    var match = document.cookie.match(regexp);
    if (match) {
        var rawValue = match[1];
        try {
            var decodedValue = decodeURIComponent(rawValue);
            return decodedValue;
        } catch(e) {}
    }
    return "";
}

function adjustStickySkyscraper() {
    if (curResolution == "mobile_hr" || curResolution == "mobile_lr" || typeof dfpSlots == 'undefined')
        return;

    if(getCookie("seleniumtest") != "") return;

    var slot = document.querySelector(".ac_leftslot.sticky #ad_leftslot_a");
    if (slot == null)
        return;

    var slotHeight = slot.offsetHeight;
    var slotMarginTop = 11;
    var slotMarginBottom = 20;
    var slotPositionTop = 10;
    var bodyHeight = document.body.scrollHeight;
    var bodyScroll = window.pageYOffset;

    var header = document.getElementById("ox-header");
    var headerHeight = header != null ? header.offsetHeight : 0;
    var stickyHeader = document.getElementById("searchbar");
    var stickyHeaderHeight = stickyHeader != null ? stickyHeader.offsetHeight : 0;
    var cookieLawHeader = document.getElementById("cookieLaw");
    var clhHeight = clhHeight != null ? clhHeight.offsetHeight : 0;
    var topslotContainer = document.getElementById("ad_topslot_a");
    var tcHeight = curResolution != "hd" && topslotContainer != null ? topslotContainer.offsetHeight + slotMarginTop : 0;

    var footer = document.getElementById("ox-footer");
    var bodyPaddingBottom = footer != null ? footer.offsetHeight : 0;

    // too high
    if(bodyScroll < clhHeight + tcHeight + headerHeight) {
        slotPositionTop = clhHeight + tcHeight + headerHeight + stickyHeaderHeight + slotMarginTop - bodyScroll;
    } else {
        slotPositionTop = stickyHeaderHeight + slotMarginTop; 
    }

    // too low
    if (slotPositionTop > bodyHeight - bodyScroll - slotHeight - slotMarginBottom - bodyPaddingBottom)
        slotPositionTop = bodyHeight - bodyScroll - slotHeight - slotMarginBottom - bodyPaddingBottom;

    slot.style.position = "fixed";
    slot.style.top = slotPositionTop + "px";
    slot.style.bottom = "auto";

    // reset the sticky skyscraper callbacks, that are only required when
    // resizing the window
    if (dfpSlots["leftslot_a"])
        dfpSlots["leftslot_a"].renderCallback = null;
}

function isMobileDevice() {
    return (/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent));
}

function isMobileMode() {
    return (curResolution == "mobile_hr" || curResolution == "mobile_lr" || isMobileDevice());
}

function getPrebidSlots(res) {
    if (res == "hd") return pbHdSlots
    else if (res == "tablet") return pbTabletSlots
    else if (res == "mobile_hr") return pbMobileHrSlots
    else if (res == "mobile_lr") return pbMobileLrSlots
    else return pbDesktopSlots
}

function addPrebidAdUnits(adUnits, dfpSlots) {
    pbjs.que.push(function() {
        pbjs.addAdUnits(adUnits);
        iasLog('addPrebidAdUnits() - Request PrebidSlots:', adUnits);
        pbjs.requestBids({
            timeout: PREBID_TIMEOUT,
            bidsBackHandler : function (bidResponses) {
                sendPrebidServerRequest(dfpSlots);
            }
        });
    });
}


function removePrebidAdUnits() {
    pbjs.que.push(function() {
        pbjs.adserverRequestSent = false;
        for (var i=0;i<pbAdUnits.length;i++) {
            pbjs.removeAdUnit(pbAdUnits[i].code);
        }
    });
}

function sendPrebidServerRequest(dfpSlots) {
    if (pbjs.adserverRequestSent) return;
    pbjs.adserverRequestSent = true;
    googletag.cmd.push(function() {
        pbjs.que.push(function() {
            pbjs.setTargetingForGPTAsync();
            if(dfpSlots !== undefined) {
                iasLog("sendAdserverRequest() - Request DfpSlots: ", dfpSlots);
                googletag.pubads().refresh(dfpSlots);
            }
            else {
                iasLog("sendAdserverRequest() - All DfpSlots");
                googletag.pubads().refresh();
            }
        });
    });
}

/***************** Auto refresh *************************/
var refreshConfig = {
    enabled : true,
    inactivityThreshold : 2,            // Number of seconds to consider user inactive (without activity events).
    extendedVisibilityHeight : 400,     // Number of pixels of non-visible zone (check soon visible or soon hidden).
    useAdSlotCenter : true,             // Use slot center visibility rather than boundaries (top on above zone, bottom in below zone)
    defaultVisibility : 20,             // Minimum slot visibility seconds to trigger a slot refresh
    defaultMaxImpressions: 15           // Maximum slot refresh
};

var refreshStatus = {
    slotsStats : {},
    inactivityDuration : 0,
    userTabbedOut : false,
    lastScrollPosition:  window.pageYOffset || document.documentElement.scrollTop,
    scrollUp: false,
    activityAndVisibilityInterval : undefined,
    refreshCandidateSlotsTimeout : undefined
};

function getSlotConfigs() {
    if(isMobileMode()) {
        // Mobile / Tablet
        return {
            'topslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
            'topslot_b' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
            'leftslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 20},
            'btmslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
            'btmslot_b' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
            'contentslot_1' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true},
            'contentslot_2' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true},
            'contentslot_3' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true},
            'contentslot_4' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true},
            'contentslot_5' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true},
            'contentslot_6' : { 'refreshEnabled' : true, 'minVisibility' : 10, 'sizeRestriction' : true}
        }
    }
    // Desktop
    return {
        'topslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 22, 'sizeRestriction' : true},
        'topslot_b' : { 'refreshEnabled' : true, 'minVisibility' : 22, 'sizeRestriction' : true},
        'leftslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 20},
        'btmslot_a' : { 'refreshEnabled' : true, 'minVisibility' : 25, 'sizeRestriction' : true},
        'btmslot_b' : { 'refreshEnabled' : true, 'minVisibility' : 25, 'sizeRestriction' : true},
        'contentslot_1' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
        'contentslot_2' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
        'contentslot_3' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
        'contentslot_4' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
        'contentslot_5' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true},
        'contentslot_6' : { 'refreshEnabled' : true, 'minVisibility' : 15, 'sizeRestriction' : true}
    }
}

function getSlotName(slotElementId) {
    return slotElementId.substr(_prefix.length);
}

function getSlotElementId(slotName) {
    return _prefix + slotName;
}
function getSlotStats(slotName) {
    if (typeof refreshStatus.slotsStats[slotName] === 'undefined') {
        refreshStatus.slotsStats[slotName] = {visibility: 0, impressions: 1, viewable: false};
    }
    return refreshStatus.slotsStats[slotName];
}

function isAdSlotVisible(elm, zone) {
    var zone = zone || 'visible';

    var slotRect = elm.getBoundingClientRect();

    // Ad is collapsed (not requested or not bidded)
    if(slotRect.width == 0 && slotRect.height == 0)
        return false;

    var slotAboveY = refreshConfig.useAdSlotCenter ? (slotRect.bottom + slotRect.top) / 2 : slotRect.bottom;
    var slotBelowY = refreshConfig.useAdSlotCenter ? (slotRect.bottom + slotRect.top) / 2 : slotRect.top;
    var viewHeight = Math.max(document.documentElement.clientHeight, window.innerHeight);

    var isAbove = slotAboveY <= 0;
    var isBelow = slotBelowY - viewHeight >= 0;

    if (zone === 'visible') {
        return !isAbove && !isBelow;
    } else if (zone === 'above') {
        var isAboveExtended = slotAboveY + refreshConfig.extendedVisibilityHeight <= 0;
        return isAbove && !isAboveExtended;
    } else {
        var isBelowExtended = slotBelowY - viewHeight - refreshConfig.extendedVisibilityHeight >= 0;
        return isBelow && !isBelowExtended;
    }
}

function getAdFrame(slotElementId) {
    // get the iFrame element inside the ad slot div
    var slotElement = document.getElementById(slotElementId);
    if(typeof slotElement == undefined || slotElement.getElementsByTagName('iframe') == undefined) {
        iasLog("Unable to find slot element or iframe:", slotName);
        return;
    }
    var adSlotFrame = slotElement.getElementsByTagName('iframe')[0];
    return adSlotFrame;
}

function getElementSize(adSlotFrame) {
    var style = getComputedStyle(adSlotFrame);
    var width = adSlotFrame.offsetWidth + parseInt(style.marginLeft) + parseInt(style.marginRight);
    var height = adSlotFrame.offsetHeight + parseInt(style.marginTop) + parseInt(style.marginBottom);
    return [width, height];
}

function setElementSize(adSlotFrame, width, height) {
    if(width != null)
        adSlotFrame.style.width = width + 'px';
    if(height != null)
        adSlotFrame.style.height = height + 'px';
    iasLog(adSlotFrame.id + " - set size: [" + width + "," + height + "]");
}

function adjustSlotSize(event) {
    var adSlotFrame = getAdFrame(event.slot.getSlotElementId());
    if(adSlotFrame == undefined)
        return;

    var slotSize = getElementSize(adSlotFrame);
    if(slotSize[0] <= 1 || slotSize[1] <= 1) {
        // Slot size is not correct, retrieve creative size from prebid
        var winningBids = pbjs.getAllWinningBids();
        if(winningBids != undefined) {
            var adId = event.slot.getTargetingMap()["hb_adid"];
            var adPrebidInfo = winningBids.filter(function(bid) { return adId == bid.adId; })[0];
            if (adPrebidInfo != undefined && adPrebidInfo.width > 1 && adPrebidInfo.height > 1) {
                setElementSize(adSlotFrame, adPrebidInfo.width, adPrebidInfo.height);
                setElementSize(adSlotFrame.parentElement, adPrebidInfo.width, adPrebidInfo.height);
            }
        }
    }
}

function getVisibleAdSlots(useExtendedVisibilityZone) {
    var visibleSlots = [];

    if(typeof dfpSlots == 'undefined' )
        return;

    Object.keys(dfpSlots).forEach(function(slotName) {
        var adSlotElement = document.getElementById(getSlotElementId(slotName));
        if(adSlotElement == null)
            return;

        var adSlotVisible = isAdSlotVisible(adSlotElement);

        if(useExtendedVisibilityZone) {
            var adSlotInAboveZone = isAdSlotVisible(adSlotElement, "above");
            var adSlotInBelowZone  = isAdSlotVisible(adSlotElement, "below");
            var adSlotSoonHidden = refreshStatus.scrollUp ? adSlotInBelowZone : adSlotInAboveZone;
            var adSlotSoonVisisble = refreshStatus.scrollUp ? adSlotInAboveZone : adSlotInBelowZone;

            if((adSlotVisible && !adSlotSoonHidden) || adSlotSoonVisisble)
                visibleSlots.push(slotName);
        } else if (adSlotVisible)
            visibleSlots.push(slotName);
    });

    return visibleSlots;
}

function applySlotSizeRestriction(dfpSlot, pbSlot, apstagSlot, slotSize, forceWidth) {
    if(slotSize[1] <= 1) {
        // Slot was not filled, disable ad refresh
        return false;
    }

    // Prebid - general sizes
    var restrictedSizes = pbSlot.mediaTypes.banner.sizes.filter(function(size) {
        return size[1] == slotSize[1];
    });
    pbSlot.mediaTypes.banner.sizes = restrictedSizes;

    if(restrictedSizes == 0) {
        // Ad size is not standard, disable ad refresh
        return false;
    }

    // DFP
    googletag.cmd.push(function() {
        var mapping = googletag.sizeMapping().addSize([0, 0], restrictedSizes).build();
        dfpSlot.defineSizeMapping(mapping);
    });
    // fix slot container size to prevent content jump
    var slotElement = document.getElementById(dfpSlot.getSlotElementId());
    var width = forceWidth ? slotSize[0] : null;
    setElementSize(slotElement, width, slotSize[1]);

    // Amazon
    if(apstagSlot != undefined) {
        apstagSlot.sizes = apstagSlot.sizes.filter(function(size) {
            return size[1] == slotSize[1];
        });
    }

    // Prebid - bidders
    var restrictedBidders = [];
    pbSlot.bids.forEach(function(bid) {
        if(["rubicon", "appnexus", "criteo", "openx"].indexOf(bid.bidder) >= 0) {
            restrictedBidders.push(bid);
        } else if (bid.bidder == "ix" && bid.params.size[1] == slotSize[1]) {
            restrictedBidders.push(bid);
        } /* else {
            iasLog("Excluding bid: ", bid);
        } */
    });

    pbSlot.bids = restrictedBidders;

    return true;
}

function refreshCandidateSlots() {
    var dfpSlotsToRefresh = [];
    var pbSlotsToRefresh = [];
    var slotsToRefresh = [];
    var candidateSlots = getVisibleAdSlots(true);

    iasLog("refreshCandidateSlots triggered - Check candidate slots stats:", candidateSlots);
    var prebidSlots = getPrebidSlots(curResolution);

    candidateSlots.forEach(function(slotName) {
        var slotStats = getSlotStats(slotName);
        var slotConfig = getSlotConfigs()[slotName];
        var slotElementId = getSlotElementId(slotName);

        if(slotConfig === undefined)
            return;

        if(!slotConfig.refreshEnabled || false) {
            iasLog(slotName + " is not configured to be refreshed.");
            return;
        }

        var minVisibility = slotConfig.minVisibility || refreshConfig.defaultVisibility ;
        if(minVisibility > slotStats.visibility) {
            iasLog(slotName + " have not reached minimum visibility time: " + minVisibility + " (" + slotStats.visibility +")" );
            return;
        }

        var maxImpressions = slotConfig.maxImpressions || refreshConfig.defaultMaxImpressions ;
        if(slotStats.impressions >= maxImpressions) {
            iasLog(slotName + " have reached maximum impressions: " + maxImpressions);
            return;
        }
        iasLog(slotName + " can be refreshed: ", slotStats);

        // Retrieve slot units
        var dfpSlot = dfpSlots[slotName];
        var pbSlot = prebidSlots.filter(function(slot) { return slotElementId == slot.code; })[0];

        // Refresh size restriction
        var adFrame = getAdFrame(slotElementId);
        var slotSize = getElementSize(adFrame);
        if(slotConfig.sizeRestriction && slotSize != undefined) {
            iasLog(slotName + " size: ", slotSize);
            if(!applySlotSizeRestriction(dfpSlot, pbSlot, null, slotSize, slotConfig.forceWidth)) {
                iasLog(slotName + " refresh cancelled as format is not standard: ", slotSize);
                return;
            }
        }

        // Update slot stats
        dfpSlot.setTargeting(_target_sri, slotStats.impressions.toString());
        slotStats.visibility = 0;
        slotStats.viewable = false;
        slotStats.impressions++;

        dfpSlotsToRefresh.push(dfpSlot);
        pbSlotsToRefresh.push(pbSlot);
        slotsToRefresh.push(slotName);
    });

    if (dfpSlotsToRefresh.length > 0) {
        iasLog("  Trigger refreshing on slots:", slotsToRefresh);
        removePrebidAdUnits();
        addPrebidAdUnits(pbSlotsToRefresh, dfpSlotsToRefresh);
    }
}

function startActivityAndVisibilityMonitor() {
    clearInterval(refreshStatus.activityAndVisibilityInterval);
    refreshStatus.activityAndVisibilityInterval = setInterval(function(){
        refreshStatus.inactivityDuration++;
        if(refreshStatus.inactivityDuration === refreshConfig.inactivityThreshold) {
            iasLog("User is becoming inactive");
        }

        if(!refreshStatus.userTabbedOut) {
            getVisibleAdSlots(false).forEach(function(slotName) {
                if(getSlotStats(slotName).viewable)
                    getSlotStats(slotName).visibility++;
            });
        }
    }, 1000);
}

function activityHandler(){
    // User is being active after inactivity period
    if(refreshStatus.inactivityDuration >= refreshConfig.inactivityThreshold) {
        clearTimeout(refreshStatus.refreshCandidateSlotsTimeout);
        refreshStatus.refreshCandidateSlotsTimeout = window.setTimeout(refreshCandidateSlots, 50);
    }
    refreshStatus.inactivityDuration = 0;
    refreshStatus.userTabbedOut = false;
}

function initAdSlotRefresher() {
    iasLog("initAdSlotRefresher");

    // Simple activity events
    var activityEvents = ['keydown','mousedown', 'mousemove', 'touchstart', 'click', 'focus'];

    activityEvents.forEach(function(eventName) {
        document.addEventListener(eventName, activityHandler, true);
    });

    // Scroll
    document.addEventListener('scroll', function() {
        var scrollTop = window.pageYOffset || document.documentElement.scrollTop;
        if (scrollTop > refreshStatus.lastScrollPosition) {
         refreshStatus.scrollUp = false;
        } else {
         refreshStatus.scrollUp = true;
        }
        refreshStatus.lastScrollPosition = scrollTop <= 0 ? 0 : scrollTop;
        activityHandler();
    }, true);

    // Tab out
    window.addEventListener('blur', function() {
        refreshStatus.userTabbedOut = true;
    }, true);
    
    googletag.pubads().addEventListener('impressionViewable', function(event) {
        var slotName = getSlotName(event.slot.getSlotElementId());
        getSlotStats(slotName).viewable = true;
        // Ensure prebid ads are correctly sized after refresh
        adjustSlotSize(event);
    });

    startActivityAndVisibilityMonitor();
}

function resetAdSlotRefresher() {
    iasLog("resetAdSlotRefresher");
    refreshStatus.slotsStats = {};
}

function iasLog () {
    if (showLogs) {
        console.log.apply(console, decorateLog(arguments));
    }
}

function decorateLog(args) {
    args = [].slice.call(args);
    args.unshift('display:inline-block; color:#fff; background:#82b533; padding:1px 4px; border-radius:3px;');
    args.unshift('%cIAS');
    return args;
}

